DROP TABLE IF EXISTS `plan`;
CREATE TABLE `plan`  (
  `ID` int NOT NULL AUTO_INCREMENT,
  `TYPE` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `NAME` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `MAJOR_ORIE_ID` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `GRADE` int NOT NULL,
  `START_D` datetime NOT NULL,
  `END_D` datetime NOT NULL,
  `CLASS_HOUR` int NOT NULL,
  `CREDIT` float NOT NULL,
  `PERCENT_IN` int NULL DEFAULT NULL,
  `PERCENT_EX` int NULL DEFAULT NULL,
  `IS_DELETED` tinyint(1) NULL DEFAULT NULL,
  `CONTENT` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `OBJECTIVE` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `DEMAND` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `SCORE_CAL_TYPE` int NOT NULL,
  `PERCENT_IN_DAILY_REPORT` int NULL DEFAULT NULL,
  `PERCENT_IN_WEEKLY_REPORT` int NULL DEFAULT NULL,
  `PERCENT_IN_MONTHLY_REPORT` int NULL DEFAULT NULL,
  `PERCENT_IN_SUMMARY` int NULL DEFAULT NULL,
  `DEADLINE` date NULL DEFAULT NULL,
  `CREATOR` int NOT NULL DEFAULT -1,
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 41 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

