-- ----------------------------
-- Table structure for planchoose
-- ----------------------------
DROP TABLE IF EXISTS `planchoose`;
CREATE TABLE `planchoose`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NULL DEFAULT NULL,
  `plan_id` int NULL DEFAULT NULL,
  `status` int NULL DEFAULT NULL COMMENT '0-未确定; 1-导师已确认; 2-单位与导师已确认',
  `create_time` datetime NOT NULL,
  `score` int NOT NULL DEFAULT -1 COMMENT '<0 - 未打分',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 17 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

