-- ----------------------------
-- Table structure for report
-- ----------------------------
DROP TABLE IF EXISTS `report`;
CREATE TABLE `report`  (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `title` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NOT NULL,
  `content` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL,
  `type` int NULL DEFAULT NULL COMMENT '1-周记; 2-月记; 3-总结',
  `status` int NULL DEFAULT NULL COMMENT '0-正常; 1-精华; 2-拉黑',
  `create_time` timestamp NULL DEFAULT NULL,
  `comment` text CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL,
  `score` double NULL DEFAULT NULL,
  `is_deleted` int NULL DEFAULT 0,
  `is_read` int NOT NULL DEFAULT 0 COMMENT '1-read; 0-unread',
  `is_pass` int NOT NULL DEFAULT 0 COMMENT '1-pass; 0-none; -1-fail',
  `lasted_edit_user_id` int NULL DEFAULT NULL,
  `att_id` varchar(255) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci NULL DEFAULT NULL,
  `is_draft` int NOT NULL DEFAULT 1 COMMENT '1-draft; 0-common',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `index_user_id`(`user_id` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 110021 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_general_ci ROW_FORMAT = DYNAMIC;

